style.css:
@-moz-document domain("roblox.com") {
/* Set the background GIF */
  body {
    background-image: url('https://giphy.com/gifs/rX9Wzw8A9UJCKbvRHx') !important; /* Replace with your Shogun Raiden GIF URL */
    background-size: cover !important;
    background-position: center center !important;
    background-attachment: fixed !important;
    background-repeat: no-repeat !important;
  }

  /* Keep the rest of the website readable */
  .container, .navbar, .footer, .main-content, .profile-container {
    background-color: rgba(255, 255, 255, 0.8) !important; /* Light background to make text and content readable */
    color: #000000 !important; /* Ensure text is black for contrast */
  }

  /* Ensure no additional color changes are applied */
  button, .btn-primary {
    background-color: inherit !important; /* Inherit the original button color */
    color: inherit !important; /* Inherit the original text color */
  }

  /* Prevent altering other elements too much */
  h1, h2, h3, h4, h5, h6, p, a, li, span {
    color: inherit !important; /* Keep the original colors of the site */
  }
}
